# !pip install pyspark

from pyspark.sql import SparkSession
from pyspark.sql.functions import col, regexp_replace
from pyspark.sql.functions import monotonically_increasing_id

spark = SparkSession.builder \
    .appName("Atividade01") \
    .getOrCreate()

"""## Atividade 1

![image.png](data:image/png;base64,)
"""

df = spark.read.csv("/content/janeiro_pagamentos_bf.csv", header=False, inferSchema=True,sep=";")
df.show()

df.printSchema()

df = df.withColumn("_c8", regexp_replace(col("_c8"), ",", ".").cast("float"))
df.show()

df.printSchema()

"""- Quantidade de pessoas beneficiadas pelo programa em cada estado"""

pessoas_estado = df.groupBy("_c2").count()
pessoas_estado.show()

"""- As 50 cidades com a maior quantidade de beneficiados no Brasil"""

top50 = df.groupBy("_c4").count().orderBy(col("count").desc()).limit(50)
top50.show()

"""- Total de pagamento realizados pelos estados do Brasil no período de Janeiro
de 2021
"""

periodo_inicio = 202101
periodo_fim = 202112

ano = df.filter((col("_c0") >= periodo_inicio) & (col("_c0") <= periodo_fim))

# Agrupar por coluna 'categoria' e somar os valores da coluna 'valor_float'
pag_estado_2021 = ano.groupBy("_c2").sum("_c8").withColumnRenamed("sum(_c8)", "total_pagamentos")
pag_estado_2021.show()

"""- As 10 cidades com a maior valor total de pagamentos para os estados e São
Paulo e Bahia
"""

estados = df.filter((col("_c2") == "SP") | (col("_c2") == "BA"))
estado_cidade = estados.groupBy("_c4").sum("_c8").withColumnRenamed("sum(_c8)", "total_pagamentos")
top10 = estado_cidade.orderBy(col("total_pagamentos").desc()).limit(10)
top10.show()

"""- As 100 cidade de 3 estados (a escolher) com a maior quantidade de pessoas
beneficiadas com o programa
"""

estados2 = df.filter((col("_c2") == "MG") | (col("_c2") == "MA") | (col("_c2") == "RJ"))
estados2_cidades2 = estados2.groupBy("_c4").count().withColumnRenamed("count", "total_beneficiados")
top100 = estados2_cidades2.orderBy(col("total_beneficiados").desc()).limit(100)
top100.show()

"""## Atvidade 2

![image.png](data:image/png;base64,)
"""

df2 = spark.read.csv("/content/fevereiro_pagamentos_bf.csv", header=False, inferSchema=True,sep=";")

df2_indice = df2.withColumn("indice", monotonically_increasing_id())
indice_primeira_linha = df2_indice.agg({"indice": "min"}).collect()[0][0]
df2_atualizado = df2_indice.filter(df2_indice.indice != indice_primeira_linha)
df2 = df2_atualizado.drop("indice")
df2.show()

df3 = spark.read.csv("/content/marco_pagamentos_bf.csv", header=False, inferSchema=True,sep=";")

df3_indice = df3.withColumn("indice", monotonically_increasing_id())
indice_primeira_linha = df3_indice.agg({"indice": "min"}).collect()[0][0]
df3_atualizado = df3_indice.filter(df3_indice.indice != indice_primeira_linha)
df3 = df3_atualizado.drop("indice")
df3.show()

dfs = df.union(df2).union(df3)
dfs.show()

dfs.write.parquet("/content/bases_pagamentos_bf.parquet")

parquet_df = spark.read.parquet("/content/bases_pagamentos_bf.parquet")
parquet_df.show()

parquet_df = parquet_df.withColumn("_c8", regexp_replace(col("_c8"), ",", ".").cast("float"))
parquet_df = parquet_df.withColumn("_c0", regexp_replace(col("_c0"), ",", ".").cast("integer"))
parquet_df.printSchema()

"""- Quantidade de pessoas beneficiadas pelo programa em cada estado"""

pessoas_estado_all = parquet_df.groupBy("_c2").count()
pessoas_estado_all.show()

"""- As 50 cidades com a maior quantidade de beneficiados no Brasil"""

top50_all = parquet_df.groupBy("_c4").count().orderBy(col("count").desc()).limit(50)
top50_all.show()

"""- Total de pagamento realizados pelos estados do Brasil no período de Janeiro
de 2021
"""

periodo_inicio_all = 202101
periodo_fim_all = 202112

ano_all = parquet_df.filter((col("_c0") >= periodo_inicio_all) & (col("_c0") <= periodo_fim_all))

# Agrupar por coluna 'categoria' e somar os valores da coluna 'valor_float'
pag_estado_2021_all = ano_all.groupBy("_c2").sum("_c8").withColumnRenamed("sum(_c8)", "total_pagamentos")
pag_estado_2021_all.show()

"""- As 10 cidades com a maior valor total de pagamentos para os estados e São
Paulo e Bahia
"""

estados_all = parquet_df.filter((col("_c2") == "SP") | (col("_c2") == "BA"))
estado_cidade_all = estados_all.groupBy("_c4").sum("_c8").withColumnRenamed("sum(_c8)", "total_pagamentos")
top10_all = estado_cidade_all.orderBy(col("total_pagamentos").desc()).limit(10)
top10_all.show()

"""- As 100 cidade de 3 estados (a escolher) com a maior quantidade de pessoas
beneficiadas com o programa
"""

estados2_all = parquet_df.filter((col("_c2") == "MG") | (col("_c2") == "MA") | (col("_c2") == "RJ"))
estados2_cidades2_all = estados2_all.groupBy("_c4").count().withColumnRenamed("count", "total_beneficiados")
top100_all = estados2_cidades2_all.orderBy(col("total_beneficiados").desc()).limit(100)
top100_all.show()

"""## Atividade 3

![image.png](data:image/png;base64,)
"""

clientes = spark.read.parquet("/content/Clientes.parquet")
clientes.show()

clientes_consulta = clientes.drop("ClienteID", "Genero")
clientes_consulta.show()

clientes_status = clientes_consulta.filter((col("Status") == "Platinum")| (col("Status") == "Gold"))
clientes_status.show()

vendas = spark.read.parquet("/content/Vendas.parquet", schema = True)
vendas.show()

vendas.printSchema()

from pyspark.sql.functions import col, sum as spark_sum, round as spark_round

vendas_cliente = vendas.join(clientes, vendas.ClienteID == clientes.ClienteID)

#total de vendas por status
total_vendas_status = vendas_cliente.groupBy('Status').agg(spark_round(spark_sum('Total'), 2).alias('Total_status'))
total_vendas_status.show()

# total geral de vendas
total_vendas = total_vendas_status.agg(spark_sum('Total_status').alias('Total_geral')).collect()[0]['Total_geral']
total_vendas

# proporção de vendas para cada status
vendas_por_status = total_vendas_status.withColumn('Proporcao', spark_round(col('Total_status') / total_vendas, 4) * 100)
vendas_por_status.show()